import React from 'react';
import styled from 'styled-components';

const Dot = styled.div`
  background: var(--red);
  color: white;
  border-radius: 50%;
  padding: 0 0.5rem;
  line-height: 2rem;
  min-width: 3rem;
  margin-left: 1rem;
`;

const CartCount = ({ count }) => <Dot>{count}</Dot>;

export default CartCount;
